import s from './Menu.module.css';


const Menu = () => {
    return (
        <nav className={s.menu}>
            <div><a src='#s'>Profile</a></div>
            <div><a src='#s'>Messages</a></div>
            <div><a src='#s'>News</a></div>
            <div><a src='#s'>Music</a></div>
            <div><a src='#s'>Settings</a></div>
        </nav>
    )
}


export default Menu;
